import React from 'react';

function MainPage({housedata}) {
    return (<div>
      {housedata.map((h) => (
        <div key={Date.now()} style={{ border: '1px solid black' }}>
          <h3>{h.name}</h3>
          <img alt={h.name} src={h.pic} />
          <p>Price: {h.price}</p>
          <p>Size: {h.size}</p>
          <p>
            <span style={{ fontWeight: 'bold' }}>About:</span>
            {h.desc}
          </p>
        </div>
      ))}
    </div>)
}

export default MainPage;
